    public class Finder
    {

        public class Node
        {
            public int i;
            public int j;
            public int w;
            public int totalw;
        }

        static int[,] array_maze = null;

        static int[,] array_maze_w = null;

        static int bound;

        static List<Node> path = null;

        public static int PathFinder(string maze)
        {
            string[] maze_arr = maze.Split(new string[] { "\n" }, StringSplitOptions.RemoveEmptyEntries);

            bound = maze_arr.Length;

            array_maze = new int[bound, bound];

            array_maze_w = new int[bound, bound];

            for (int i = 0; i < maze_arr.Length; i++)
            {
                for (int j = 0; j < maze_arr.Length; j++)
                {
                    array_maze[i, j] = Convert.ToInt32(maze_arr[i][j].ToString());
                    array_maze_w[i, j] = -1;
                }
            }

            path = new List<Node>();
            path.Add(new Node()
            {
                i = 0,
                j = 0,
                w = array_maze[0, 0],
                totalw = 0
            });

            array_maze_w[0, 0] = 0;

            Node objNode;

            while (path.Any())
            {
                objNode = GetMinTotalW();
                GetNextNode(objNode.i, objNode.j - 1, objNode.w, objNode.totalw);
                GetNextNode(objNode.i, objNode.j + 1, objNode.w, objNode.totalw);
                GetNextNode(objNode.i - 1, objNode.j, objNode.w, objNode.totalw);
                GetNextNode(objNode.i + 1, objNode.j, objNode.w, objNode.totalw);
            }
            return array_maze_w[bound - 1, bound - 1];
        }

        public static Node GetMinTotalW()
        {
            Node minTotalWNode = null;
            foreach (Node objnode in path)
            {
                if (minTotalWNode == null)
                {
                    minTotalWNode = objnode;
                }
                else if (objnode.totalw < minTotalWNode.totalw)
                {
                    minTotalWNode = objnode;
                }
            }
            path.Remove(minTotalWNode);
            return minTotalWNode;
        }

        public static void GetNextNode(int i, int j, int w, int totalW)
        {
            if ((i < 0) || (i >= bound))
            {
                return;
            }
            if ((j < 0) || (j >= bound))
            {
                return;
            }

            int nextw = Math.Abs(array_maze[i, j] - w) + totalW;

            if (array_maze_w[i, j] == -1)
            {
                array_maze_w[i, j] = nextw;
            }
            else
            {
                if (nextw < array_maze_w[i, j])
                {
                    path.RemoveAll(o => (o.i == i && o.j == j));
                    array_maze_w[i, j] = nextw;
                }
                else
                {
                    return;
                }
            }

            path.Add(new Node()
            {
                i = i,
                j = j,
                w = array_maze[i, j],
                totalw = nextw
            });

        }
    }

    public class Finder2
    {

        public class Node
        {
            public int i;
            public int j;
            public int w;
            public int totalw;
        }

        public static int PathFinder(string maze)
        {

            int[][] array_maze = null;

            int[][] array_maze_w = null;

            int bound;

            List<Node> path = new List<Node>();

            string[] maze_arr = maze.Split(new string[] { "\n" }, StringSplitOptions.RemoveEmptyEntries);

            bound = maze_arr.Length;

            array_maze = new int[bound][];
            array_maze_w = new int[bound][];

            for (int i = 0; i < maze_arr.Length; i++)
            {
                array_maze[i] = Array.ConvertAll(maze_arr[i].ToCharArray().Select(c => c.ToString()).ToArray(), Convert.ToInt32);
                array_maze_w[i] = new int[bound];
                array_maze_w[i] = array_maze_w[i].Select(o => o = -1).ToArray();
            }


            path.Clear();
            path.Add(new Node()
            {
                i = 0,
                j = 0,
                w = array_maze[0][0],
                totalw = 0
            });

            array_maze_w[0][0] = 0;

            Node objNode;

            while (path.Any())
            {
                objNode = path[0];
                path.RemoveAt(0);
                GetNextNode(objNode.i, objNode.j - 1, objNode.w, objNode.totalw, bound, array_maze, array_maze_w, path);
                GetNextNode(objNode.i, objNode.j + 1, objNode.w, objNode.totalw, bound, array_maze, array_maze_w, path);
                GetNextNode(objNode.i - 1, objNode.j, objNode.w, objNode.totalw, bound, array_maze, array_maze_w, path);
                GetNextNode(objNode.i + 1, objNode.j, objNode.w, objNode.totalw, bound, array_maze, array_maze_w, path);
            }
            return array_maze_w[bound - 1][bound - 1];
        }

        public static void GetNextNode(int i_next, int j_next, int w, int totalW, int bound, int[][] array_maze, int[][] array_maze_w, List<Node> path)
        {
            if ((i_next < 0) || (i_next >= bound))
            {
                return;
            }
            if ((j_next < 0) || (j_next >= bound))
            {
                return;
            }

            int w_next = Math.Abs(array_maze[i_next][j_next] - w) + totalW;

            if (array_maze_w[i_next][j_next] == -1)
            {
                array_maze_w[i_next][j_next] = w_next;
            }
            else
            {
                if (w_next < array_maze_w[i_next][j_next])
                {
                    path.RemoveAll(o => (o.i == i_next && o.j == j_next));
                    array_maze_w[i_next][j_next] = w_next;
                }
                else
                {
                    return;
                }
            }

            path.Add(new Node()
            {
                i = i_next,
                j = j_next,
                w = array_maze[i_next][j_next],
                totalw = w_next
            });

        }
    }

